import { Route, Routes } from 'react-router-dom';
import './App.css';
import home from './components/home/home'
import login from './components/login/login'

function App() {

  return (
    <Routes>
      <Route Component={home} path='/' />
      <Route Component={login} path='/login' />
      <Route Component={login} path='/login' />
    </Routes>
  )
}

export default App;
